import React from "react"

class ProfileStatus extends React.Component {

    StatusState = {
        OnStatusChanging: false
        
    }


    render() {

        return (
            <div>
                {!this.StatusState.OnStatusChanging ?
                    <div>

                         <span onDoubleClick={ ()=>{alert("its working")}}>
                       {this.props.status}
                        </span>
                    </div>
                    :
                    <div>
                        <input value={this.props.status}/>
                    </div>
                }
            </div>
        )
    }
}

export default ProfileStatus
